class AuthManager {
  constructor() {
    this.auth = false;
  }

  async Login(email, pass) {
    console.log(`Login ${email} ${pass}`);
    this.auth = true;
    return true;
  }
  async CreateAccount(ssn, email, pass) {
    console.log(`Create Account ${ssn} ${email} ${pass}`);
    return true;
  }

  isAuthed() {
    return this.auth;
  }
}

const auth = new AuthManager();

export default auth;
